import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {//Fetch data from flaskbackend
    fetch('http://127.0.0.1:5000/') //Port flask is on
      .then((response) => response.text()) //message from Flask
      .then((data) => setMessage(data))//capture message from flask
      .catch((error) => console.log('Error fetching data:', error));
  }, []);

  return (
    <div className="App">
        <img src= "teacup.jpg" alt="teacup" width="100" height="110"></img>
        <header class ="navigation">
          <ul>
            <li>Settings
              <ul>
                <li>Change Password</li>
                <li>Blocked Users</li>
                <li>Saved Posts</li>
              </ul>
            </li>
            <li>User Profile</li> 
            <li>Notifications</li>
            <li>Friends</li>
          </ul>
        </header>
        <p>{message || 'Backend data stuff'}</p> {/*flask message*/}
    </div>
  );
}

export default App;
